import React from "react";
import { v4 as uuidv4 } from 'uuid';
export default class RadioButton extends React.Component {

    constructor(props) {
        super(props)
    }

    render() {
        let id = uuidv4();
        return (
            <div>
                <h5 className="card-subtitle text-muted mt-3">Generated Page Title Ideas</h5>
                <div class="col">
                    <div className="card p-2 m-2 h-100">
                        <div class="form-check">
                            <input class="form-check-input" type="radio" name={this.props.name} id={id} />
                            <label class="form-check-label" for={id}>
                                {this.props.value}
                            </label>
                        </div>
                    </div>
                </div>
            </div>
        )
    }

}
